import React, { Component } from "react";
import Header from "./components/Header";
import Discover from "./components/Discover";
import "./App.css";

export class App extends Component {
  render() {
    return (
      <div>
        <Header />
        <Discover />
      </div>
    );
  }
}

export default App;
